import React from 'react';
import * as ReactDOMClient from 'react-dom/client';
import { MainComponent } from './Principal.js';

try {
  const contenedor = document.getElementById('root');
  const root = ReactDOMClient.createRoot(contenedor);
  root.render(
    <React.StrictMode>
      <MainComponent />
    </React.StrictMode>
  );
} catch (e) {
  console.log(e);
}
